import React from "react";
import { Route, Routes, BrowserRouter } from "react-router-dom";

// import "./formInput.css";

import { useRef, useState } from "react";

// COMPONENTS
// import Login from "./Login";
import SignUp from "./SignUp";
import Dashboard from "./Dashboard";
import FirstLogin from "./FirstLogin";
import FirstLogin2 from "./FirstLogin2";
import FormInput from "./FormInput";
// ANOTHER ONE HERE FOR THE VEHICLES RESULTS PAGE

// import

// Login page needs to have link to SignUp component

// This is already the form.
// Start the

export default function Form() {
  // const [firstname, setFirstname] = useState("");

  const handleSubmit = function (e) {
    e.preventDefault();
    const data = new FormData(e.target);
    console.log(Object.fromEntries(data.entries()));
  };

  return (
    <div className="form-container">
      <form onSubmit={handleSubmit}>
        <FormInput name="firstname" placeholder="First Name" />
        <FormInput name="lastname" placeholder="Last Name" />
        <FormInput type="email" name="email" placeholder="Email" />
        <FormInput name="phone" placeholder="Phone Number" />
        <FormInput name="username" placeholder="Username" />
        <FormInput name="password" placeholder="Password" />
        <FormInput name="passwordConfirm" placeholder="Password Confirm" />
        <button>Submit</button>
      </form>
    </div>
  );
}
